    /* Optional subtle overlay to improve text contrast */
    .overlay{
      position:fixed;
      inset:0;
      background:
        radial-gradient(900px 520px at 50% 62%, rgba(0,0,0,.20), rgba(0,0,0,.60) 70%),
        linear-gradient(180deg, rgba(0,0,0,.35), rgba(0,0,0,.55));
      z-index:-2;
      pointer-events:none;
    }

    /* Layout */
    .wrap{
      min-height:100%;
      display:flex;
      align-items:center;
      justify-content:center;
      padding:48px 18px 56px;
    }

    .panel{
      width:min(760px, 100%);
      text-align:center;
      position:relative;
    }

    .brand{
      display:inline-flex;
      align-items:baseline;
      gap:2px;
      margin-bottom:30px;
      letter-spacing:.2px;
      user-select:none;
      text-shadow: 0 18px 55px rgba(0,0,0,.65);
    }
    .brand strong{ font-weight:650; font-size: clamp(24px, 4vw, 38px); color: rgba(255,255,255,.92); }
    .brand span{ font-weight:450; font-size: clamp(24px, 4vw, 38px); color: rgba(255,255,255,.55); }

    .content{
      margin-top: clamp(240px, 38vh, 520px);
    }

    .headline{
      margin:0 0 12px;
      font-size: clamp(34px, 5.3vw, 56px);
      font-weight:650;
      letter-spacing:.2px;
      text-shadow: 0 18px 55px rgba(0,0,0,.70);
    }

    .sub{
      margin:0 auto;
      max-width: 560px;
      font-size: 18px;
      line-height:1.7;
      color:var(--muted);
      text-shadow: 0 18px 55px rgba(0,0,0,.55);
    }
    .sub small{
      display:block;
      margin-top:10px;
      color:var(--muted2);
      font-size:16px;
    }

    .form{
      margin:26px auto 12px;
      width:min(640px, 100%);
      display:flex;
      gap:14px;
      align-items:stretch;
      justify-content:center;
      padding:10px;
    }

    input[type="email"]{
      width:100%;
      height:66px;
      padding:0 22px;
      border-radius:999px;
      border:1px solid rgba(255,255,255,.10);
      background: rgba(10,14,26,.40);
      color:rgba(255,255,255,.92);
      outline:none;
      box-shadow: 0 14px 36px rgba(0,0,0,.35) inset;
      backdrop-filter: blur(10px);
      -webkit-backdrop-filter: blur(10px);
      font-size:18px;
    }
    input::placeholder{ color: rgba(232,238,252,.35); }
    input:focus{
      border-color: rgba(88,210,255,.55);
      box-shadow: 0 0 0 5px rgba(88,210,255,.12), 0 14px 36px rgba(0,0,0,.35) inset;
    }

    .btn{
      height:66px;
      padding:0 28px;
      border:0;
      border-radius:999px;
      color:white;
      font-size:20px;
      font-weight:600;
      cursor:pointer;
      background: linear-gradient(180deg, rgba(120,212,255,.95), rgba(41,121,255,.92));
      box-shadow: var(--glow), var(--shadow);
      transition: transform .12s ease, filter .12s ease, box-shadow .12s ease;
      white-space:nowrap;
      min-width: 170px;
    }
    .btn:hover{ transform: translateY(-1px); filter: brightness(1.05); }
    .btn:active{ transform: translateY(0px) scale(.99); filter: brightness(.98); }
    .btn:disabled{
      cursor:not-allowed;
      filter:saturate(.7) brightness(.9);
      box-shadow: 0 0 0 1px rgba(255,255,255,.10), 0 10px 28px rgba(0,0,0,.45);
      opacity:.88;
    }

    .fineprint{
      margin-top:10px;
      color: rgba(232,238,252,.35);
      font-size: 16px;
      text-shadow: 0 14px 40px rgba(0,0,0,.65);
    }

    .msg{
      margin-top:14px;
      min-height:24px;
      font-size:15px;
      text-shadow: 0 14px 40px rgba(0,0,0,.65);
    }
    .msg.ok{ color: rgba(140,255,200,.88); }
    .msg.err{ color: rgba(255,170,170,.90); }

    @media (max-width: 560px){
      .content{ margin-top: clamp(220px, 34vh, 420px); }
      .form{ flex-direction:column; }
      .btn{ width:100%; min-width:0; }
      input[type="email"]{ height:62px; font-size:17px; }
      .btn{ height:62px; font-size:18px; }
    }

    .sr-only{
      position:absolute !important;
      height:1px; width:1px;
      overflow:hidden;
      clip: rect(1px, 1px, 1px, 1px);
      white-space:nowrap;
    }
  </style>
</head>

<body>
  <div class="bg" aria-hidden="true"></div>
  <div class="overlay" aria-hidden="true"></div>

  <main class="wrap">
    <section class="panel" aria-label="Coming soon landing page">
      <div class="brand" aria-label="Seedlings.world">
        <strong>Seedlings</strong><span>.world</span>
      </div>

      <div class="content">
        <h1 class="headline">Something is growing</h1>

        <p class="sub">
          We’re building something special.
          <small>Leave your email and we’ll let you know when it is ready.</small>
        </p>

        <form class="form" id="notifyForm" name="notify" method="POST" data-netlify="true" netlify-honeypot="bot-field" novalidate>
          <input type="hidden" name="form-name" value="notify" />
          <p class="sr-only">
            <label>Don’t fill this out if you’re human: <input name="bot-field" /></label>
          </p>
          <label class="sr-only" for="email">Your email address</label>
          <input
            id="email"
            name="email"
            type="email"
            inputmode="email"
            autocomplete="email"
            placeholder="Your email address"
            required
          />
          <button class="btn" id="btn" type="submit">Notify me</button>
        </form>

        <div class="fineprint">No spam. Just the moment it’s ready.</div>
        <div class="msg" id="msg" aria-live="polite"></div>
      </div>
    </section>
  </main>

  <script>
    (function () {
      const form = document.getElementById("notifyForm");
      const email = document.getElementById("email");
      const btn = document.getElementById("btn");
      const msg = document.getElementById("msg");

      const saved = localStorage.getItem("seedlings_email");
      if (saved) email.value = saved;

      function setMessage(text, kind) {
        msg.textContent = text || "";
        msg.className = "msg" + (kind ? " " + kind : "");
      }

      function isValidEmail(value) {
        return /^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(String(value).trim());
      }

      
      form.addEventListener("submit", async (e) => {
        e.preventDefault();
        setMessage("");

        const value = email.value.trim();
        if (!value) {
          setMessage("Please enter your email address.", "err");
          email.focus();
          return;
        }
        if (!isValidEmail(value)) {
          setMessage("Please enter a valid email address.", "err");
          email.focus();
          return;
        }

        btn.disabled = true;
        btn.textContent = "Sending…";

        try {
          const res = await fetch("/.netlify/functions/signup", {
            method: "POST",
            headers: { "Content-Type": "application/json" },
            body: JSON.stringify({ email: value })
          });

          const data = await res.json().catch(() => ({}));

          if (!res.ok) {
            throw new Error((data && data.error) ? data.error : "Request failed");
          }

          if (data.status === "exists") {
            setMessage("This email is already registered.", "ok");
            btn.disabled = false;
            btn.textContent = "Notify me";
            return;
          }

          window.location.href = "/success.html";
        } catch (err) {
          setMessage("Something went wrong. Please try again.", "err");
          btn.disabled = false;
          btn.textContent = "Notify me";
        }
      });
const data = new FormData<form name="notify" method="POST" data-netlify="true" action="/success.html">
  <input type="hidden" name="form-name" value="notify">
;
          const res = await fetch("/", { method: "POST", body: data });
          if (!res.ok) throw new Error("Netlify form submit failed");
          setMessage("You’re on the list. We’ll email you when it’s ready.", "ok");
        } catch (err) {
          setMessage("Something went wrong. Please try again.", "err");
        } finally {
          btn.disabled = false;
          btn.textContent = "Notify me";
        }
      });
    })();
  </script>
</body>
</html>
